import React from "react";
import Cabang from "../sections/Cabang";
import Jabar from "../sections/Jabar";
import Masakan from "../sections/Masakan";
import Recomendation from "../sections/Recomendation";
import SectionLove from "../sections/SectionLove";

function MenuItem() {
  return (
    <div>
      <SectionLove />
      <Recomendation />
      <Masakan />
      <Cabang />
      <Jabar />
    </div>
  );
}

export default MenuItem;
